import React from "react";
import { NavLink } from "react-router-dom";

const navigationItem = (props) => (
    <li>
        <NavLink to={props.link} activeClassName={{style:{backgroundColor:"red"}}}>
            {props.children}
        </NavLink>
    </li>
)

export default navigationItem;
